import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Button from './common/Button';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Button>
          <div>
            Test button
          </div>
        </Button>
      </div>
    );
  }
}

export default App;
